    def rows(self):
        if os.path.exists('pacientes.txt'):
            if os.stat('pacientes.txt').st_size == 0:
                row = 1
                return row
            else:
                data = []
                with open(f'pacientes.txt', 'rb') as file_row:
                    while True:
                        try:
                            info = pickle.load(file_row)
                            data.append(info)
                        except EOFError:
                            break
                row = len(data) + 1
                file_row.close()
                return row
        else:
            open('pacientes.txt', 'ab').close()
            row = 1
            return row

